import React,{useState} from 'react'
import Axios from "axios"

function DeliveryTakeAway() {

  // const[deliveryIsChecked,setDeliveryIsChecked] = useState(false);
  // const[takeAwayIsChecked,setTakeAwayIsChecked] = useState(false);

  const[isChecked,setIsChecked]=useState(false)

  const deliveryStatus=false;

  const storeStatus = () => {
    Axios.post("http://localhost:3001/AddtoCart/DeliveryStatus",{
      deliveryStatus:isChecked
    })
    console.log("delivery",isChecked);
  }

    return (
        <div>
        <div className="container-fluid" style={{marginTop:"0px", fontSize:"20px",fontFamily:"Postmates"}}>
        <div>
        <div className="container">
        <div className="row">

          <div className="col-md-12">
            <h2 className="grid-title">Delivery Option</h2>
            <hr />
            <div class="checkbox">
              <label><input
              type="checkbox"
              className="icheck"
              name="deliveryType"
              checked={isChecked}
              value="delivery"
              onChange={
                (e) => {
                  setIsChecked(e.target.checked);
                }
              }
              />
              Delivery
              </label>
            </div>
            <div className="checkbox1">
              <label><input
              type="checkbox"
               className="icheck"
               name="deliveryType"
               checked={isChecked}
               value="takeAway"
               id="check2"
              onChange={
                (e) => {
                  setIsChecked(e.target.checked);
                }
              }
              />
              Take Away
              </label>
            </div>
            <div className="padding">
            <button type="button" style={{borderRadius:"100%",backgroundColor:"green"}} onClick={storeStatus}>✔️</button>
            </div>
            <div className="padding">
            </div>
          </div>
          </div>
          </div>
          </div>
          </div>
          </div>
    )
}

export default DeliveryTakeAway;
